CREATE TABLE `gw_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品id，同时也是商品编号',
  `title` varchar(100) NOT NULL COMMENT '商品标题',
  `image` varchar(500) DEFAULT NULL COMMENT '商品图片',
  `price` decimal(10,4) NOT NULL COMMENT '参考价格',
  `discountprice` decimal(10,4) NOT NULL COMMENT '参考折扣价格',
  `buyingprice` decimal(10,4) NOT NULL COMMENT '进货价格',
  `stock` int(10) NOT NULL COMMENT '库存数量',
  `distribute` int(10) NOT NULL COMMENT '已铺货数量',
  `allsellcount` int(10) NOT NULL COMMENT '销量',
  `created` datetime NOT NULL COMMENT '创建时间',
  `updated` datetime NOT NULL COMMENT '更新时间',
  `cid` bigint(10) NOT NULL COMMENT '所属类目id',
  `cname` varchar(20) NOT NULL COMMENT '所属类目名称',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '商品状态，1-正常，2-库存不足，3-下架',
  `sid` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`),
  KEY `cid` (`cid`),
  KEY `status` (`status`),
  KEY `updated` (`updated`),
  CONSTRAINT `gw_product_ibfk_1` FOREIGN KEY (`cid`) REFERENCES `gw_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10148 DEFAULT CHARSET=utf8 COMMENT='商品表';
